import logo from './logo.svg';
import './App.css';
import { Link, Redirect } from 'react-router-dom';
import {Card, Button} from 'react-bootstrap';


function App() {
  return (
    <div className="App">
      <header className="App-header">

      <Card border="primary" style={{ width: '18rem' }}>
    <Card.Header>Nevada</Card.Header>
    <Card.Body>
      <Card.Text>0 New Cases</Card.Text>
      <Card.Text>0 Deaths</Card.Text>

    </Card.Body>
  </Card>


      </header>
    </div>
  );
}

export default App;
